import React from 'react';

const SocialNetwork = () => {
    return (
        <div className="social-network">
            <ul className="content">
                <a href="https://www.facebook.com/sidymamadou.diallo.5" target="_blank" rel="noopener noreferrer" className="hover">
                    <li>
                        <i className='fab fa-facebook'></i>
                    </li>
                </a>
                <a href="" target="_blank" rel="noopener noreferrer" className="hover">
                    <li>
                        <i className='fab fa-twitter'></i>
                    </li>
                </a>
                <a href="https://www.instagram.com/entrepreneur_riche24/?hl=fr" target="_blank" rel="noopener noreferrer" className="hover">
                    <li>
                        <i className='fab fa-instagram'></i>
                    </li>
                </a>
            </ul>
        </div>
    );
};

export default SocialNetwork;
